import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image } from 'react-native';

export default function App() {
  return (
    <View style={s.container}>
      <View style={s.header}>
        <View>
          <Text>Icon</Text>
        </View>
        <View style={s.greeting}>
          <Text style={s.greetingText}> Hello,</Text>
          <Text style={s.profileName}>Sali</Text>
        </View>
        <View style={s.imageWrapper}>
          <Image style={s.image} source={{ uri: 'https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cmFuZG9tJTIwcGVvcGxlfGVufDB8fDB8fA%3D%3D&w=1000&q=80' }} />
        </View>
      </View>
    </View>
  );
}

const s = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F2F2F2',
  },
  header: {
    width: '100%',
    height: '10%',
    backgroundColor: 'green',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: "center",
    paddingHorizontal: 24,
    // paddingTop: 20
  },
  greeting: {
    alignItems: 'center'
  },
  greetingText: {
    fontFamily: 'monospace',
    fontSize: 16,
    fontWeight: '500',
  },
  profileName: {
    paddingTop: 4,
    fontFamily: 'monospace',
    fontSize: 18,
    fontWeight: '550',
  },
  imageWrapper: {
    backgroundColor: 'red',
    width: 40,
    height: 40,
  },
  image: {
    height: '90%',
    width: '90%',
  }

})
